import sys 
from collections import deque
import heapq 

def solution():
    while heap : 
        height, i,j = heapq.heappop(heap)
        if height != maps[i][j] : 
            continue 
        origin_i, origin_j = i,j 
        succ = True 
        q = deque([(i,j)])
        mini = float('inf')
        visit = set()
        while q : 
            x,y = q.popleft() 
            visit.add((x,y))
            for px,py in zip(dx,dy):
                nx,ny = x+px, y+py 
                if 0<=nx<n and 0<=ny<m :
                    if (nx,ny) in visit:
                        continue
                    if height == maps[nx][ny] :
                        q.append((nx,ny)) 
                        visit.add((nx,ny))
                        continue 
                    elif height < maps[nx][ny] and mini > maps[nx][ny]:
                        mini = maps[nx][ny] 
                    elif height > maps[nx][ny] : 
                        succ = False 
                        break 
                else : 
                    succ = False 
                    break 
            if not succ :
                break 
        if succ :
            for x,y in visit :
                fill[x][y] += mini - maps[x][y] 
                maps[x][y] = mini
            heapq.heappush(heap,(mini,origin_i,origin_j))

input = sys.stdin.readline 
n,m = map(int,input().split())
maps = [list(map(int,input().split())) for _ in range(n)] 
fill = [[0 for _ in range(m)] for _ in range(n)] 
visited = [[ True for _ in range(m)] for _ in range(n)] 
dx = [-1,0,1,0]
dy = [0,-1,0,1]

heap = [] 
for i in range(1,n-1): 
    for j in range(1,m-1): 
        heapq.heappush(heap, (maps[i][j],i,j))
solution()
ans = 0 
for f in fill : 
    ans += sum(f)
    print(f)
print(ans)
